import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faChevronDown } from '@fortawesome/free-solid-svg-icons';
import { faFacebook, faInstagram, faLinkedin } from '@fortawesome/free-brands-svg-icons';

export const downArrow = <FontAwesomeIcon icon={faChevronDown} className={{  }} />;
export const facebook = <FontAwesomeIcon icon={faFacebook} className="social-icon" style={{ width: "30px", height: "30px", color: "black" }} />;
export const instagram = <FontAwesomeIcon icon={faInstagram} className="social-icon" style={{ width: "30px", height: "30px", color: "black" }} />;
export const linkedin = <FontAwesomeIcon icon={faLinkedin} className="social-icon" style={{ width: "30px", height: "30px", color: "black" }} />;
